import React from "react";
import "./app.css";

function App() {
  return (
    <div className="app">
      <div className="app_calculator">
        <div className="app_calculator_navbar">
          <div className="app_calculator_navbar_toggle">
            <div className="app_calculator_navbar_toggle_circle" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
